import React, { Component } from 'react';
import '../index.css';

export default class Donate extends Component {
  render() {
    return (
    <div className="container">
      <input id="username" type="text" name="username" autocorrect="off" spellcheck="false" autocomplete="off" />
      <label>Username</label>
    </div>
    )
  }
}
